import React from 'react';
import ReactDOM from 'react-dom';

let object =
{
  avatarUrl: "{https://www.w3schools.com/js/js_object_properties.asp}",
  athor: "Seytech",
  text:"Some text",
  date: "12/08/2010"
}

const UserInfoName = (props) => <div>{props.athor}</div>;
const Avatar       = (props) => <img src="{props.avatarUrl}"></img>;
const CommentText  = (props) => <div>{props.text}</div>;
const CommentDate  = (props) => <div>{props.date}</div>;

const UserInfo = () => <div><Avatar/>,<UserInfoName/></div>;
const Comment = () => <div><UserInfo/>,<CommentText/>,<CommentDate/></div>;

const App = () => (
                <div>
                  <Comment/>
                </div>
              );


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
